import React from 'react'

const Todo = () => {
    function myfun(){
        
    }
    const cars = [
        { name: 'Toyota' },
        { name: 'Honda' },
        { name: 'BMW' },
        { name: 'Mercedes-Benz' },
        { name: 'Ford' },
        { name: 'Chevrolet' },
        { name: 'Audi' },
        { name: 'Nissan' },
        { name: 'Volkswagen' },
        { name: 'Tesla' },
    ];
    return (
        <div>
            <input type="text" placeholder='Enter a car name' onChange={myfun}/> 
            <button className='btn btn-primary'>Add</button>
            {
                cars.map((n) => (
                    <div>
                        <p><b>Car Name : </b>{n.name}</p>
                    </div>
                ))
            }
        </div>
    )
}

export default Todo
